import React from "react";
import { BsHouseDoorFill } from "react-icons/bs";
import { FaUserFriends } from "react-icons/fa";
import { AiOutlineVideoCamera } from "react-icons/ai";
import "../Menu/Menu.css";
export default function Menu() {
  return (
    <div className="menu_wrapper">
      <div className="menu_suggest">
        <ul className="menu_suggest--list">
          <li className="menu_suggest--item">
            <a className="menu_suggest--item--link" href="#">
              <BsHouseDoorFill className="menu_suggest--item-icon" />{" "}
              <span>Dành cho bạn</span>
            </a>
          </li>
          <li className="menu_suggest--item">
            <a className="menu_suggest--item--link" href="#">
              <FaUserFriends className="menu_suggest--item-icon" /> Đang theo
              dõi
            </a>
          </li>
          <li className="menu_suggest--item">
            <a className="menu_suggest--item--link" href="#">
              <AiOutlineVideoCamera className="menu_suggest--item-icon" /> LIVE
            </a>
          </li>
        </ul>
      </div>
    </div>
  );
}
